int
Genome_trim_left (Compress_T query_compress,
		  UINT4 *blocks, UINT4 *snp_blocks, Genomicpos_T left, int pos5, int pos3,
		  bool dibasep, bool cmetp, bool plusp) {
  if (dibasep) {
    /* Not implemented */
    return 0;

  } else if (snp_blocks == NULL) {
    return trim_left_substring(query_compress,blocks,left,pos5,pos3,cmetp,plusp);
  } else {
    return trim_left_substring_snps(query_compress,blocks,snp_blocks,
				    left,pos5,pos3,cmetp,plusp);
  }
}

int
Genome_trim_right (Compress_T query_compress,
		   UINT4 *blocks, UINT4 *snp_blocks, Genomicpos_T left, int pos5, int pos3,
		   bool dibasep, bool cmetp, bool plusp) {
  if (dibasep) {
    /* Not implemented */
    return 0;

  } else if (snp_blocks == NULL) {
    return trim_right_substring(query_compress,blocks,left,pos5,pos3,cmetp,plusp);
  } else {
    return trim_right_substring_snps(query_compress,blocks,snp_blocks,
				     left,pos5,pos3,cmetp,plusp);
  }
}



